import React from "react";
import LazyHero from "react-lazy-hero";
import CookieConsent from "react-cookie-consent";
import { Helmet } from "react-helmet";
import { Container, Row, Col } from "reactstrap";
import {
  Animation,
  MDBBtn,
  MDBJumbotron,
  MDBContainer,
  MDBRow,
  MDBCol,
  MDBCard,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBModal,
  MDBModalBody,
  MDBModalHeader,
  MDBModalFooter,
  MDBInput,
  MDBIcon,
  MDBCarousel,
  MDBCarouselCaption,
  MDBCarouselInner,
  MDBCarouselItem,
  MDBView,
  MDBMask,
  MDBTable,
  MDBTableBody,
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
  MDBNavbarToggler,
  MDBCollapse,
  MDBNavItem,
  MDBNavLink
} from "mdbreact";
import { connect } from "react-redux";

import "bootstrap/dist/css/bootstrap.min.css";
import "./Home.css";

class Paketdienstleister extends React.Component {
  // Scroll to top when changing sites

  componentWillUnmount() {
    window.scrollTo(0, 0);
  }

  constructor(props) {
    super(props);
    this.state = {
      collapse: false
    };
    this.onClick = this.onClick.bind(this);
  }

  componentDidMount() {
    this.props.dispatch({ type: "NAVHOME" });
    if (this.state.collapse) {
      this.setState({
        collapse: !this.state.collapse
      });
    }
  }

  onClick() {
    this.setState({
      collapse: !this.state.collapse
    });
  }

  render() {
    return (
      <div className="Home Background">
        {/* Hero-Image newes Version*/}
        <LazyHero
          color="#ffffff"
          minHeight="70vh"
          style={{ background: "#ffffff" }}
        >
          <MDBContainer className="Jumbotron3" fluid no-gutters>
            <MDBRow no-gutters>
              <MDBCol size="12">
                <h1
                  style={{
                    "padding-bottom": "1%",
                    "padding-top": "1%",
                    fontSize: "2em"
                  }}
                >
                  <b>
                    {" "}
                    Massiv steigendes Sendungsvolumen und immer weniger
                    Paketzusteller
                  </b>
                </h1>
              </MDBCol>
            </MDBRow>
            <MDBRow no-gutters>
              <MDBCol size="12">
                <h1
                  style={{
                    "padding-bottom": "1%",
                    "padding-top": "1%",
                    "padding-left": "4%",
                    "padding-right": "4%",
                    fontSize: "3em"
                  }}
                >
                  <br />
                  PAXET - Die Lösung mit viele Vorteilen
                </h1>
              </MDBCol>
            </MDBRow>
          </MDBContainer>
        </LazyHero>

        <MDBJumbotron
          className="Jumbotron3"
          fluid
          no-gutters
          style={{
            "padding-top": "0px"
          }}
        >
          <MDBContainer className="Jumbotron" fluid no-gutters>
            <div
              style={{
                "padding-bottom": "0px",
                fontSize: "1em"
              }}
            >
              <MDBRow
                style={{
                  "padding-left": "10%",
                  "padding-top": "2.5%",
                  "padding-right": "10%",
                  height: "5%"
                }}
              >
                <MDBCol
                  size="lg"
                  md="12"
                  sm="12"
                  className="align-self-top"
                  style={{ fontSize: "0.5em", "padding-top": "2.5%" }}
                >
                  <MDBTable borderless responsive>
                    <MDBTableBody>
                      <div>
                        <tr>
                          <td style={{ height: "27ch" }}>
                            <h2
                              style={{
                                "padding-bottom": "1.5%",
                                "padding-top": "2%"
                              }}
                            >
                              Entlastung der Paketboten
                            </h2>
                            <h3
                              style={{
                                "padding-bottom": "2.5%",
                                fontSize: "2em"
                              }}
                            >
                              Die Paketboten profitieren aufgrund der
                              PAXET-Community von einer 100%-igen
                              Zustellsicherheit, sodass keine mehrmaligen
                              Zustellversuche mehr notwendig sind und mehrere
                              Zustellungen in kürzerer Zeit abgewickelt werden
                              können.
                            </h3>
                          </td>
                        </tr>
                      </div>
                    </MDBTableBody>
                  </MDBTable>
                </MDBCol>
                <MDBCol
                  size="lg"
                  md="12"
                  sm="12"
                  className="align-self-top"
                  style={{ fontSize: "0.5em", "padding-top": "2.5%" }}
                >
                  <MDBTable borderless responsive>
                    <MDBTableBody>
                      <div>
                        <tr>
                          <td style={{ height: "27ch" }}>
                            <h2
                              style={{
                                padding: "1.5%"
                              }}
                            >
                              Mehr Umsatz
                            </h2>
                            <h3
                              style={{
                                padding: "1.5%",
                                fontSize: "2em"
                              }}
                            >
